export const UserModal = () => {

    return (
        <div className="modalBackground">
            <div className="modalContainer">
                <button type="button" className="close-btn">x</button>
                <User />
                <p>User<button type="button" className="open-modal-btn" onClick={() => {
                    setOpenModal(true);
                }}><FontAwesomeIcon icon={faPen} /></button></p>
                <button type="button">Change Name</button>
                <button type="button">Save Name</button> 
                <button type="button">Logout</button>
            </div>
        </div>
    )
}
